import React, { useEffect } from 'react';
import '../../css/contact.css';

const Contact = () => {

  useEffect(() => {
    document.title = "SHAREHOME - Contact us";
  });

  return (
    <div class="content">
      <h1 class="title">Get in touch</h1>
    </div>
  );
}

export default Contact;
